import React from 'react';
import styled from 'styled-components';

const Nav = () => {

return (
<NavStyled> 
    <div className='nested-wrapper'>
        <a href="/">Welcome</a>
        <a href="/">Services</a>
        <a href="/">Contact</a>
        <a href="/">Login</a>
    </div>
</NavStyled>
)

}

export default Nav;

const NavStyled = styled.nav`
    background-color: teal;
    color: white;

    a {
        display: inline-block;
        text-align: center;
        line-height: 50px;
        font-size: 20px;
        background-color: maroon;
        color: white;

        text-decoration: none;

        width: 150px;
        margin-right: 10px;
        margin-left: 10px;

        &:hover {
            background-color: black;
        }
    }
`;
